function dosomething(attempts, completions, yards, tds, ints, compr, yardr, tdr, intr, minAtt, minComp, maxComp, minYards, maxYards, minInt, maxInt, minTd, maxTd, pmInt){
  if (attempts>=minAtt){
    var a; var b;var c; var d;
    var rawcp = completions*10000/attempts;
    if (rawcp>maxComp){rawcp = maxComp;}
    if (rawcp<minComp){rawcp = minComp;}
    a = rawcp*compr-minComp*compr;
    var rawyp = yards*100/attempts;
    if (rawyp>maxYards){rawyp = maxYards;}
    if (rawyp<minYards){rawyp = minYards;}
    b = rawyp*yardr-minYards*yardr;
    var rawtp = tds*10000/attempts;
    if (rawtp>maxTd){rawtp = maxTd;}
    if (rawtp<minTd){rawtp = minTd;}
    c = rawtp*tdr-minTd*tdr;
    var rawip = ints*10000/attempts;
    if (rawip>maxInt){rawip = maxInt;}
    if (rawip<minInt){rawip = minInt;}
    if (pmInt==1){d = maxInt*intr-rawip*intr;}
    else {d = -rawip*intr;}

    return (a+b+c+d)/12;
  }
  else {return 0;}
  
}


